var tipuesearch = {"pages": [{'title': 'member', 'text': '個人網站: \xa0 40723205 \xa0王立瑋 \n 個人網站:\xa0 40723221 \xa0邱正宇 \n 個人網站:\xa0 40723228 \xa0郭倞 \n 個人網站:\xa0 40723229 \xa0陳羽泓 \n 個人網站:\xa0 40723235 \xa0馮寬永 \n 個人網站:\xa0 40723240 \xa0楊朝有 \n 個人網站:\xa0 40723246 \xa0鄭竣元 \n 個人網站: \xa0 40723247 \xa0賴冠勛 \n 個人網站 :\xa0 40723250 \xa0羅村偉 \n', 'tags': '', 'url': 'member.html'}, {'title': 'week', 'text': '', 'tags': '', 'url': 'week.html'}, {'title': 'w10-w12', 'text': '', 'tags': '', 'url': 'w10-w12.html'}, {'title': 'w13-w15', 'text': '', 'tags': '', 'url': 'w13-w15.html'}, {'title': 'w16-w18', 'text': '', 'tags': '', 'url': 'w16-w18.html'}, {'title': 'solvespace', 'text': '', 'tags': '', 'url': 'solvespace.html'}, {'title': 'tutorial video', 'text': '第1題 \n 操作影片: \n \n 成品圖: \n \n 第3題 \n 操作影片: \n \n 成品圖: \n \n 第4題 \n 操作影片: \n \n 成品圖: \n \n 第6題 \n 操作影片: \n \n 成品圖: \n \n 第7題 \n 操作影片: \n \n 成品圖: \n \n 第8題 \n 操作影片: \n \n 成品圖: \n \n 第9題 \n 操作影片: \n \n 成品圖: \n \n 第10題 \n 操作影片: \n \n 成品圖: \n \n 第11題 \n 操作影片: \n \n 成品圖: \n \n 第12題: \n 1.繪製長方形形狀的本體 \n 2.繪製上方左右兩片圓柱形特徵 \n 3.連接兩片圓柱型特徵 \n 4.挖除中央圓型孔洞 \n 5.下方圓型柱也以一樣的方式繪製並且若出現紅色部分則可以使用 右上視窗的force nurbs surfaces to triangle鈕消除錯誤 \n 操作影片: \n \n 成品圖: \n \n 第13題: \n 1.繪製梯形形狀的本體 \n 2.繪製上方兩片梯形特徵 \n 3.挖除梯形特徵上的槽孔 \n 4.繪製底部圓柱若出現紅色部分則使用右上方視窗assemble按鈕 \n 5.挖除中央圓孔若出現紅色部分使用右上視窗的force nurbs surfaces to triangle鈕 \n 操作影片: \n \n 成品圖: \n \n 第14題 \n 操作影片: \n \n 成品圖: \n \n 第15題 \n 操作影片: \n \n 成品圖: \n \n 第16題 \n 1.將solvespace打開 \n 2.繪製本體外徑為5.75厚度為1.5的圓 \n 3.轉到主要工作平面並且移除一外徑為5.25厚度為1.25的圓型孔 \n 4.轉到主要工作平面，繪製一外徑為3.5的參考圓並且在其影片提到之位置會上4組具有外徑1厚度為0.25且中央有一0.5孔之特徵 \n 5.轉到主要工作平面移除中央外徑4.25之圓型孔 \n 6.轉到主要工作平面繪製8個外徑為0.5的圓型孔所有大小可以使用快捷鍵G使其一致 \n 操作影片: \n \n 成品圖: \n \n 第17題 \n 操作影片: \n \n 成品圖: \n \n 第18題 \n 操作影片: \n \n 成品圖: \n \n', 'tags': '', 'url': 'tutorial video.html'}, {'title': 'Important hot key', 'text': '常使用的快捷鍵 \n sketch rectangle \xa0 (R) \n sketch line segment (S) \n sketch circle \xa0(C) \n constrain distance \xa0 (D) \n constrain angle \xa0 ( N) \n nearest isometric view \xa0 (F3)\xa0 \n align view to workplane (W)\xa0 \n equal length/radius/angle \xa0 (Q) \n extrude \xa0(shift+X) \n sketh arc of a circle (A) \n sketh cubic bezier spline (B) \n two line perpencudilar \xa0([) \n two line\xa0parallel \xa0 (L) \n two line symmetry \xa0 (Y) \n verticel \xa0(V) \n horizontal (H) \n same direction (X) \n split line (I) \n tangent arc (shift+A) \n benchmark (P)', 'tags': '', 'url': 'Important hot key.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端。 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};